structions please refer Rules and Syllabus Booklet or visit Institute&amp;#39;s Website &amp;ndash;&amp;nbsp;&lt;a href=&quot;http://www.iibf.org/&quot;&gt;www.iibf.org.in&lt;/a&gt;.&lt;/b&gt;&lt;/p&gt;\";s:21:\"nonmember_instruction\";s:33286:\"&lt;p align=&quot;center&quot;&gt;&lt;meta charset=&quot;utf-8&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;IMPORTANT INSTRUCTIONS TO THE CANDIDATES-&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;CAIIB Elective &amp;ndash; June, 2025&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates&amp;nbsp;are required to visit Institute&amp;rsquo;s web site www. iibf.org.in &amp;gt;&amp;gt;&amp;gt; EXAMINATION/COURSES about IMPORTANT RULES/INFORMATION FOR CANDIDATES OF EXAMINATIONS&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;SCHEDULE FOR CAIIB Elective EXAMINATIONS &amp;ndash; June, 2025&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col width=&quot;200&quot; /&gt;\r\n		&lt;col width=&quot;419&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;EXAMINATION DATE&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;SUBJECTS&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td rowspan=&quot;5&quot;&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;29-06-2025&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;1. Rural Banking&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;2. Human Resources Management&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;3. Information Technology &amp;amp; Digital Banking&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;4. Risk Management&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;5. Central Banking&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;EXAMINATION SCHEDULE :&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Examination schedule is given on the website www.iibf.org.in.&amp;nbsp; Institute reserves the right to change the Examination schedule already announced for any valid reason and said&amp;nbsp;changes will be notified on our website. In such case/s Candidates are required to appear for the examination as per&amp;nbsp;the revised schedule. Pl note that candidate/s will neither be entitled for&amp;nbsp;Refund of examination fees already paid nor adjustment of fees so paid against any future examinations of the Institute.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;ELIGIBILITY: Eligibility is governed by rules published in the Rules and Syllabus of examination. Candidates are required to&amp;nbsp;register for the examination through online&amp;nbsp;during the open period of registration as mentioned in the time table of the Examination.&amp;nbsp; Application will not be accepted after the last date.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;EXAMINATION FEES:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col width=&quot;326&quot; /&gt;\r\n		&lt;col width=&quot;221&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;First Attempt&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;1,300*&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Subsequent each attempt&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;1,300*&lt;/b&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;* Plus convenience charges and Taxes as applicable&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;MODE OF EXAMINATION:&lt;br /&gt;\r\nInstitute will conduct examination in On-line mode only.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;MEDIUM OF EXAMINATION:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Examination will be conducted in English and Hindi only.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;EXAMINATION CENTRES :&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates should appear for the examination only at the centre where they are working provided there is an examination centre at such place and if there is no examination centre, they should appear at the nearest examination centre. Result of candidate violating this rule or giving wrong information is liable for cancellation.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates are required to take utmost care and precaution in selecting the Centre as there is no provision to change the Centre in the system. Hence no request for change of centre will be entertained for any reason.&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;The Institute reserves the right to close any of the existing centre/s on account of less number of candidates appearing from that centre or any other reason which it may think fit. In such case, candidate will be advised to appear at the examination from the nearest available centre.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;STUDY MATERIAL:&amp;nbsp;Examination fee does not include cost of study material. Please refer Rules &amp;amp; Syllabus of the examination at&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;The Institute has developed a courseware to cover the syllabus. Candidates are advised to make full use of the courseware and also the updates put on the IIBF website from time to time. However, as banking and finance fields are dynamic, rules and regulations witness rapid changes. Hence, candidates should keep themselves updated on latest developments by going through Master Circulars issued by RBI, visiting the websites of organizations like RBI, SEBI, BIS etc. Please refer &amp;ldquo;Pattern of Examination&amp;rdquo;&amp;nbsp;given in Rules &amp;amp; Syllabus of the examination at www.iibf.org.in&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;USE OF SCRIBE:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;For Visually impaired &amp;amp; Orthopedically Challenged candidates, for using Scribe at the examinations of the Institute, refer the Rules/Guidelines available on the web site of the institute at www.iibf.org.in.&amp;nbsp; Candidates are advised to apply online for scribe well in advance, not later than 3 days before the examination. (This is required to make suitable arrangements at the examination venue). Candidate is required to follow this procedure for each subject of examination in case the help of scribe is required. For detailed scribe guidelines, kindly refer to the &amp;nbsp;&lt;a href=&quot;https://iibf.esdsconnect.com/uploads/Scribe_Guideline_2024.pdf&quot;&gt;GUIDELINES/RULES FOR USING SCRIBE BY VISUALLY IMPAIRED &amp;amp; ORTHOPEADICALLY CHALLENGED CANDIDATES&lt;/a&gt; on the IIBF website.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;OTHER INFORMATION:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates are required&amp;nbsp;to read the instructions /information about ON-LINE examination before appearing for the examinations. The instructions are available on Institute&amp;#39;s website www.iibf.org.in&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;ADMIT LETTER OF EXAMINATIONS:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;After successful registration of examination, SMS/email will be sent to the candidate intimating the receipt of examination forms.&amp;nbsp; Please note that the admit letters will be available for download on the Institute&amp;rsquo;s website as well as in the candidate login 10 days before the exam. Candidate/s will be able to save, download and print admit letter only 10 days before the exam.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Admit letter will be hosted on Institute&amp;rsquo;s website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;under the menu &amp;lsquo;Examination /Courses&amp;gt;Admit Letter&amp;rdquo;&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;For downloading and printing of admit letter from the above mentioned website, candidates will have to enter the following:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; i.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Membership or registration number as&amp;nbsp;login&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Edit profile password.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; iii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If candidates do not remember their Edit profile password, they have to click on the &amp;lsquo;Forgot password/Get Password&amp;rsquo; button after entering the Membership or Registration number. On clicking fresh edit profile password will be sent to their registered email id.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates are required to&amp;nbsp;produce hard copy of admit letter&amp;nbsp;along with Membership identity card or any other valid photo ID card at the examination venue.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;In the absence of hard copy of Admit Letter and Photo Identity Card, candidates will be denied permission to write Examination.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Mobile Phones&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Mobile phones and other electronic gadgets (except calculator as permissible) are not allowed in the examination hall. It is clarified that mere possession of mobile phone in the examination hall whether in switch off mode or silent mode shall also be deemed to be resorting to adoption of unfair means in the examination.&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Use of calculator&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates will be allowed to use battery operated portable calculator in the exam. The calculator can be of any type upto 6 functions, 12 digits.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Attempt to use any other type of calculator not complying with the specifications indicated above or having more features than mentioned above shall tantamount to use of unfair means. Scientific calculator is not allowed.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Other Rules/Information&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates should ensure that they sign the Attendance Sheet.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates are advised to reach the Examination Venue before the reporting time mentioned in the admit letter.&amp;nbsp;No candidate/s will be permitted to enter the Examination Venue after the gate closing time mentioned in the admit letter.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;No candidate will be permitted to leave the examination venue in the first 60 minutes from the scheduled start time of the examination.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates would be able to login to the system only with the password mentioned in this Admit Letter. This password should not be disclosed to others. Keep it safe to avoid the possible misuse.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;If the examination could not commence on scheduled time or there is delay due to Failure of power, Technical snag of whatsoever nature or for any such reason having bearing upon the conduct of examination; candidates have to: -&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Wait till resumption of power supply/solving of technical snag.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Take-up the examination at other venue arranged by the examination conducting authority.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\r\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Follow instructions given by the examination conducting authority.&lt;/b&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates are required to strictly follow all the instructions given by the examination conducting authority during the examination and adhere to Rules of the examination. Violation of any of the Rules / Instructions, misuse of the Admit Letter will be considered to be an act of serious misconduct and the Institute will take action as per the Rules of the examination, which will also be reported to the employer of the candidate.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Rules, Penalties for Misconduct / Unfair Practices :&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Communication of any sort between candidates or with outsiders is not permitted and complete silence should be maintained during the examination.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Copying answers from other candidates/other printed/Electronic material or permitting others to copy or consultation of any kind will attract the rules relating to unfair practices in the examination.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;No candidate shall impersonate others or allow others to impersonate himself/herself at the examination.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;No candidate shall misbehave/argue with the Examination Conducting Authorities at the centre.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Candidates have to compulsory return any papers given including that given for rough work to invigilator.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Candidates should not possess and / or use books, notes, periodicals, etc. in the examination hall at the time of examination / or use mathematical tables, slide rules, stencils etc. during the examination.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;If any candidate violates any of the above rules, it will be considered to be an act of misconduct and he/she will be liable for punishment mentioned below.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;PENALTIES FOR MISCONDUCT / UNFAIR PRACTICES :&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;The Institute shall have the right to impose penalties on any candidate for committing an act of misconduct/unfair practice in respect of any matter affecting the Institute or in respect of any examination conducted by the Institute or disqualifying any candidate who, they have reason to believe has received or given unfair assistance at the examination, and&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;(i) to cancel the result of such candidate in all or any of the subjects of the examination at which he/she may have appeared;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;(ii) to exclude him/her from future examinations either permanently or for a specified number of examinations;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;(iii) to report his/her name to his/her employer and&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;(iv) to take such other action against him/her as the Institute shall in their sole discretion deem fit and the decision of the Institute shall be final and binding on the candidate concerned.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;The Institute shall also have right to cancel results of any subsequent examination at which the candidate may have appeared, if such examination falls within the exclusion period in the penalty, as by reason of imposition of such a penalty of exclusion from the future examination, the candidate would not have been eligible to appear at such subsequent examinations.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;In the event of any dispute between the Institute and the member, only Competent Courts in Chennai, Kolkata, New Delhi and Mumbai alone have the jurisdiction to entertain the dispute.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;DECLARATION OF RESULTS :&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Results will be normally declared within 1 month of the conclusion of the examination. Printed result advices (original as well as duplicate) will not be sent but the same will be available on Institute&amp;#39;s website &amp;#39;www.iibf.org.in&amp;#39;, in&amp;nbsp;printable form. Candidates are required&amp;nbsp;to&amp;nbsp;download the same.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Multiple Choice Questions (MCQs) and Answers&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;ldquo;The Institute conducts its examinations through Multiple Choice&amp;nbsp; Questions (MCQs).&amp;nbsp; These MCQs are part of the&amp;nbsp; Question Bank of&amp;nbsp; the Institute and its Intellectual Property .&amp;nbsp; As a matter of policy, these MCQs and their answers will not be shared by the Institute with the candidates or others and no correspondence in this regard will be entertained.&amp;quot;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;FACILITY FOR VERIFICATION OF MARKS:&amp;nbsp;&lt;br /&gt;\r\nFacility of verification of marks will not be available for Objective Type (Multiple Choice Questions) Online examinations.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;&amp;nbsp;Marksheet/Final Certificate&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Consolidated mark sheet for candidates completing&amp;nbsp;CAIIB&amp;nbsp;examination, will be available on the Institute&amp;rsquo;s website after the declaration of results. Candidates can download the same after entering login credentials using their membership number and edit profile password.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Final certificates will be available on the website within 45 days after the declaration of result.&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;CONTACT DETAILS:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Register your queries through website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;&amp;gt; Members/Candidates Support Services(Help)&amp;nbsp;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;or&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Email all your queries to&amp;nbsp;&lt;a href=&quot;mailto:care@iibf.org.in&quot;&gt;care@iibf.org.in&lt;/a&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-c606ce62-7fff-8f66-d2e6-04c9c6b8a553&quot;&gt;Member Support Service Office:&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid