 style=&quot;width:23.96%;height:243px;&quot;&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance,&lt;br /&gt;\r\n			Professional Development Centre, Northern Zone,&lt;br /&gt;\r\n			C-5/30, Safdarjung Development Area(SDA),&lt;br /&gt;\r\n			Near SDA Local Shopping complex&lt;br /&gt;\r\n			Outer Ring Road, Opp IIT Delhi,&lt;br /&gt;\r\n			&amp;nbsp;NEW DELHI-110 016&lt;br /&gt;\r\n			Tel:011-2653 2194 / 2191 (office)&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfnz@iibf.org.in&quot;&gt;Email:iibfnz@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td style=&quot;width:26.04%;height:243px;&quot;&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Avani Heights, 2nd Floor,&lt;br /&gt;\r\n			59A, Jawaharlal Nehru Road,&lt;br /&gt;\r\n			Kolkata - 700020&lt;br /&gt;\r\n			Tel: 033-46032850&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfez@iibf.org.in&quot;&gt;Email:iibfez@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td style=&quot;width:25.0%;height:243px;&quot;&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Professional Development Centre&lt;br /&gt;\r\n			192-F, Maker Towers,&lt;br /&gt;\r\n			19th Floor, Cuffe Parade&lt;br /&gt;\r\n			MUMBAI - 400 005&lt;/p&gt;\r\n\r\n			&lt;p&gt;Email:iibfez@iibf.org.in&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Corporate Office&lt;/strong&gt;&amp;nbsp;: &amp;nbsp;Indian Institute of Banking &amp;amp; Finance, Kohinoor City, Commercial-II, Tower-1, 2nd Floor, Kirol Road, Kurla (West), Mumbai - 400 070 Tel : 022-2503 9746 / 9604 / 9907&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Please quote your membership/registration number in all your emails.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For more details, updates and instructions please refer Rules and Syllabus Booklet or visit Institute&amp;#39;s Website &amp;ndash;&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org/&quot;&gt;&lt;strong&gt;www.iibf.org.in&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;.&lt;/strong&gt;&lt;/p&gt;\";}s:8:\"old_data\";a:35:{s:2:\"id\";s:2:\"16\";s:9:\"exam_name\";s:1:\"N\";s:9:\"exam_code\";s:3:\"600\";s:11:\"description\";s:5:\"CAIIB\";s:9:\"exam_type\";s:1:\"4\";s:9:\"exam_mode\";s:1:\"0\";s:11:\"exam_medium\";s:0:\"\";s:14:\"exam_frequency\";s:1:\"0\";s:20:\"qualifying_exam_code\";s:1:\"0\";s:14:\"open_to_member\";s:1:\"0\";s:16:\"qualifying_exam1\";s:3:\"210\";s:16:\"qualifying_part1\";s:1:\"1\";s:16:\"qualifying_exam2\";s:1:\"0\";s:16:\"qualifying_part2\";s:1:\"0\";s:16:\"qualifying_exam3\";s:1:\"0\";s:16:\"qualifying_part3\";s:1:\"0\";s:8:\"examprty\";s:1:\"Y\";s:11:\"examdescshr\";s:1:\"Y\";s:9:\"elg_mem_o\";s:1:\"Y\";s:9:\"elg_mem_a\";s:1:\"N\";s:10:\"elg_mem_nm\";s:1:\" \";s:9:\"elg_mem_f\";s:1:\" \";s:10:\"elg_mem_db\";s:1:\" \";s:21:\"exam_instruction_file\";s:14:\"94508_exam.pdf\";s:18:\"member_instruction\";s:37387:\"&lt;p align=&quot;center&quot;&gt;&lt;meta charset=&quot;utf-8&quot; /&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;IMPORTANT INSTRUCTIONS TO THE CANDIDATES-&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;CAIIB &amp;ndash; June, 2025&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required to visit Institute&amp;rsquo;s web site www. iibf.org.in &amp;gt;&amp;gt;&amp;gt; EXAMINATION/COURSES about&amp;nbsp;IMPORTANT RULES/INFORMATION FOR CANDIDATES OF EXAMINATIONS&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;SCHEDULE FOR CAIIB EXAMINATIONS &amp;ndash;June, 2025&lt;/b&gt;&lt;/p&gt;\n\n&lt;table&gt;\n	&lt;colgroup&gt;\n		&lt;col width=&quot;161&quot; /&gt;\n		&lt;col width=&quot;477&quot; /&gt;\n	&lt;/colgroup&gt;\n	&lt;tbody&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;EXAMINATION DATE&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;SUBJECTS&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;01-06-2025&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Advanced Bank Management&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;14-06-2025&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Bank Financial Management&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;22-06-2025&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Advance Business &amp;amp; Financial Management&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;28-06-2025&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Banking Regulations and Business Laws&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;29-06-2025&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;&amp;nbsp;\n			&lt;table&gt;\n				&lt;colgroup&gt;\n					&lt;col width=&quot;398&quot; /&gt;\n				&lt;/colgroup&gt;\n				&lt;tbody&gt;\n					&lt;tr&gt;\n						&lt;td&gt;\n						&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;1. Rural Banking&lt;/b&gt;&lt;/p&gt;\n						&lt;/td&gt;\n					&lt;/tr&gt;\n					&lt;tr&gt;\n						&lt;td&gt;\n						&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;2. Human Resources Management&lt;/b&gt;&lt;/p&gt;\n						&lt;/td&gt;\n					&lt;/tr&gt;\n					&lt;tr&gt;\n						&lt;td&gt;\n						&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;3. Information Technology &amp;amp; Digital Banking&lt;/b&gt;&lt;/p&gt;\n						&lt;/td&gt;\n					&lt;/tr&gt;\n					&lt;tr&gt;\n						&lt;td&gt;\n						&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;4. Risk Management&lt;/b&gt;&lt;/p&gt;\n						&lt;/td&gt;\n					&lt;/tr&gt;\n					&lt;tr&gt;\n						&lt;td&gt;\n						&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;5. Central Banking&lt;/b&gt;&lt;/p&gt;\n						&lt;/td&gt;\n					&lt;/tr&gt;\n				&lt;/tbody&gt;\n			&lt;/table&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n	&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;EXAMINATION SCHEDULE :&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Examination schedule is given on the website www.iibf.org.in.&amp;nbsp; Institute reserves the right to change the Examination schedule already announced for any valid reason and said&amp;nbsp;changes will be notified on our website. In such case/s Candidates are required to appear for the examination as per&amp;nbsp;the revised schedule. Pl note that candidate/s will neither be entitled for&amp;nbsp;Refund of examination fees already paid nor adjustment of fees so paid against any future examinations of the Institute.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;ELIGIBILITY: Eligibility is governed by rules published in the Rules and Syllabus of examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required to&amp;nbsp;register for the examination through online&amp;nbsp;during the open period of registration as mentioned in the time table of the Examination.&amp;nbsp; Application will not be accepted after the last date.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;EXAMINATION FEES:&lt;/b&gt;&lt;/p&gt;\n\n&lt;table&gt;\n	&lt;colgroup&gt;\n		&lt;col width=&quot;415&quot; /&gt;\n		&lt;col width=&quot;230&quot; /&gt;\n	&lt;/colgroup&gt;\n	&lt;tbody&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;* First attempt fee&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;5,000&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;2nd attempt fee&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;1,300&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;3rd attempt fee&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;1,300&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;4th attempt fee&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;1,300&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;5th attempt fee&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;1,300&lt;/b&gt;&lt;/p&gt;\n			&lt;/td&gt;\n		&lt;/tr&gt;\n	&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;* Plus convenience charges and Taxes as applicable&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;MODE OF EXAMINATION:&lt;br /&gt;\nInstitute will conduct examination in On-line mode only.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;MEDIUM OF EXAMINATION:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Examination will be conducted in English and Hindi only.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;EXAMINATION CENTRES :&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates should appear for the examination only at the centre where they are working provided there is an examination centre at such place and if there is no examination centre, they should appear at the nearest examination centre. Result of candidate violating this rule or giving wrong information is liable for cancellation.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required to take utmost care and precaution in selecting the Centre as there is no provision to change the Centre in the system. Hence no request for change of centre will be entertained for any reason.&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;The Institute reserves the right to close any of the existing centre/s on account of less number of candidates appearing from that centre or any other reason which it may think fit. In such case, candidate will be advised to appear at the examination from the nearest available centre.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;STUDY MATERIAL:&amp;nbsp;Examination fee does not include cost of study material. Please refer Rules &amp;amp; Syllabus of the examination at&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;The Institute has developed a courseware to cover the syllabus. Candidates are advised to make full use of the courseware and also the updates put on the IIBF website from time to time. However, as banking and finance fields are dynamic, rules and regulations witness rapid changes. Hence, candidates should keep themselves updated on latest developments by going through Master Circulars issued by RBI, visiting the websites of organizations like RBI, SEBI, BIS etc. Please refer &amp;ldquo;Pattern of Examination&amp;rdquo;&amp;nbsp;given in Rules &amp;amp; Syllabus of the examination at www.iibf.org.in&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;USE OF SCRIBE:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;For&amp;nbsp;Visually impaired&amp;nbsp;&amp;amp; Orthopedically Challenged candidates, for using Scribe at the examinations of the Institute, refer the Rules/Guidelines available on the web site of the institute at www.iibf.org.in.&amp;nbsp; Candidates are advised to apply online for scribe well in advance, not later than 3 days before the examination. (This is required to make suitable arrangements at the examination venue). Candidate is required to follow this procedure for each subject of examination in case the help of scribe is required.&amp;nbsp; For detailed scribe guidelines, kindly refer to the &amp;nbsp;&lt;a href=&quot;https://iibf.esdsconnect.com/uploads/Scribe_Guideline_2024.pdf&quot;&gt;GUIDELINES/RULES FOR USING SCRIBE BY VISUALLY IMPAIRED &amp;amp; ORTHOPEADICALLY CHALLENGED CANDIDATES&lt;/a&gt; on the IIBF website.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;OTHER INFORMATION:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required&amp;nbsp;to read the instructions /information about ON-LINE examination before appearing for the examinations. The instructions are available on Institute&amp;#39;s website www.iibf.org.in&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;ADMIT LETTER OF EXAMINATIONS:&lt;/b&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;After successful registration of examination, SMS/email will be sent to the candidate intimating the receipt of examination forms.&amp;nbsp; Please note that the admit letters will be available for download on the Institute&amp;rsquo;s website as well as in the candidate login 10 days before the exam. Candidate/s will be able to save, download and print admit letter only 10 days before the exam.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Admit letter will be hosted on Institute&amp;rsquo;s website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;under the menu &amp;lsquo;Examination /Courses&amp;gt;Admit Letter&amp;rdquo;&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;For downloading and printing of admit letter from the above mentioned website, candidates will have to enter the following:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; i.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Membership or registration number as&amp;nbsp;login&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Edit profile password.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; iii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If candidates do not remember their Edit profile password, they have to click on the &amp;lsquo;Forgot password/Get Password&amp;rsquo; button after entering the Membership or Registration number. On clicking fresh edit profile password will be sent to their registered email id.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required to&amp;nbsp;produce hard copy of admit letter&amp;nbsp;along with Membership identity card or any other valid photo ID card at the examination venue.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;In the absence of hard copy of Admit Letter and Photo Identity Card, candidates will be denied permission to write Examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Mobile Phones&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Mobile phones and other electronic gadgets (except calculator as permissible ) are not allowed in the examination hall. It is clarified that mere possession of mobile phone in the examination hall whether in switch off mode or silent mode shall also be deemed to be resorting to adoption of unfair means in the examination.&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Use of calculator&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates will be allowed to use battery operated portable calculator in the exam. The calculator can be of any type upto 6 functions, 12 digits.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Attempt to use any other type of calculator not complying with the specifications indicated above or having more features than mentioned above shall tantamount to use of unfair means. Scientific calculator is not allowed.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;Other Rules/Information&lt;/b&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates should ensure that they sign the Attendance Sheet.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are advised to reach the Examination Venue before the reporting time mentioned in the admit letter.&amp;nbsp;No candidate/s will be permitted to enter the Examination Venue after the gate closing time mentioned in the admit letter.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;No candidate will be permitted to leave the examination venue in the first 60 minutes from the scheduled start time of the examination.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates would be able to login to the system only with the password mentioned in this Admit Letter. This password should not be disclosed to others. Keep it safe to avoid the possible misuse.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;If the examination could not commence on scheduled time or there is delay due to Failure of power, Technical snag of whatsoever nature or for any such reason having bearing upon the conduct of examination; candidates have to :-&lt;/b&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Wait till resumption of power supply/solving of technical snag&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Take-up the examination at other venue arranged by the examination conducting authority.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n	&lt;li aria-level=&quot;1&quot; dir=&quot;ltr&quot;&gt;\n	&lt;p dir=&quot;ltr&quot; role=&quot;presentation&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Follow instructions given by the examination conducting authority.&lt;/b&gt;&lt;/p&gt;\n	&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates are required to strictly follow all the instructions given by the examination conducting authority during the examination and adhere to Rules of the examination. Violation of any of the Rules / Instructions, misuse of the Admit Letter will be considered to be an act of serious misconduct and the Institute will take action as per the Rules of the examination, which will also be reported to the employer of the candidate.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Rules, Penalties for Misconduct / Unfair Practices :&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Communication of any sort between candidates or with outsiders is not permitted and complete silence should be maintained during the examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;Copying answers from other candidates/other printed/Electronic material or permitting others to copy or consultation of any kind will attract the rules relating to unfair practices in the examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;No candidate shall impersonate others or allow others to impersonate himself/herself at the examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;No candidate shall misbehave/argue with the Examination Conducting Authorities at the centre.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Candidates have to compulsory return any papers given including that given for rough work to invigilator.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;Candidates should not possess and / or use books, notes, periodicals, etc. in the examination hall at the time of examination / or use mathematical tables, slide rules, stencils etc. during the examination.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;If any candidate violates any of the above rules, it will be considered to be an act of misconduct and he/she will be liable for punishment mentioned below.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;PENALTIES FOR MISCONDUCT / UNFAIR PRACTICES:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;The Institute shall have the right to impose penalties on any candidate for committing an act of misconduct/unfair practice in respect of any matter affecting the Institute or in respect of any examination conducted by the Institute or disqualifying any candidate who, they have reason to believe has received or given unfair assistance at the examination, and&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;(i) to cancel the result of such candidate in all or any of the subjects of the examination at which he/she may have appeared;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;(ii) to exclude him/her from future examinations either permanently or for a specified number of examinations;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;(iii) to report his/her name to his/her employer and&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;(iv) to take such other action against him/her as the Institute shall in their sole discretion deem fit and the decision of the Institute shall be final and binding on the candidate concerned.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;The Institute shall also have right to cancel results of any subsequent examination at which the candidate may have appeared, if such examination falls within the exclusion period in the penalty, as by reason of imposition of such a penalty of exclusion from the future examination, the candidate would not have been eligible to appear at such subsequent examinations.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;In the event of any dispute between the Institute and the member, only Competent Courts in Chennai, Kolkata, New Delhi and Mumbai alone have the jurisdiction to entertain the dispute.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;DECLARATION OF RESULTS :&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Results will be normally declared within 1 month of the conclusion of the examination. Printed result advices (original as well as duplicate) will not be sent but the same will be available on Institute&amp;#39;s website &amp;#39;www.iibf.org.in&amp;#39;, in&amp;nbsp;printable form. Candidates are required&amp;nbsp;to&amp;nbsp;download the same.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Multiple Choice Questions (MCQs) and Answers&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;ldquo;The Institute conducts its examinations through Multiple Choice&amp;nbsp;Questions (MCQs).&amp;nbsp; These MCQs are part of the&amp;nbsp;Question Bank of&amp;nbsp;the Institute and its Intellectual Property .&amp;nbsp; As a matter of policy, these MCQs and their answers will not be shared by the Institute with the candidates or others and no correspondence in this regard will be entertained.&amp;quot;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;FACILITY FOR VERIFICATION OF MARKS:&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;As per the rules, request for revaluation of answer paper will not be entertained. As the type of questions administered in the examination are either MCQ based objective questions or, questions without options having specific numerical answers , the entire evaluation process is computerised and hence, the request for verification of marks by any candidate will not be considered.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Mark sheet/Final Certificate&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Consolidated mark sheet for candidates completing&amp;nbsp;CAIIB&amp;nbsp;examination, will be available on the Institute&amp;rsquo;s website after the declaration of results. Candidates can download the same after entering login credentials using their membership number and edit profile password.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Final certificates will be available on the website within 45 days after the declaration of result.&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;CONTACT DETAILS:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Register your queries through website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;&amp;gt; Members/Candidates Support Services(Help)&amp;nbsp;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;or&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Email all your queries to&amp;nbsp;&lt;a href=&quot;mailto:care@iibf.org.in&quot;&gt;care@iibf.org.in&lt;/a&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\n\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-17f94b81-7fff-3fd3-d201-352fd2aed5ed&quot;&gt;Member Support Servi