	19th Floor, Cuffe Parade&lt;br /&gt;\r\n			MUMBAI - 400 005&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Corporate Office&lt;/strong&gt;&amp;nbsp;: &amp;nbsp;Indian Institute of Banking &amp;amp; Finance, Kohinoor City, Commercial-II, Tower-1, 2nd Floor, Kirol Road, Kurla (West), Mumbai - 400 070 Tel : 022-2503 9746 / 9604 / 9907.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;PROFESSIONAL DEVELOPMENT CENTRES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Please quote your membership/registration number in all your emails.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For more details, updates and instructions please refer Rules and Syllabus Booklet or visit Institute&amp;#39;s Website &amp;ndash;&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org/&quot;&gt;&lt;strong&gt;www.iibf.org.in&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;.&lt;/strong&gt;&lt;/p&gt;\";s:21:\"nonmember_instruction\";s:22483:\"&lt;p align=&quot;center&quot;&gt;&lt;meta charset=&quot;utf-8&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;IMPORTANT INSTRUCTIONS TO THE CANDIDATES-&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;CAIIB Elective &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates&amp;nbsp;are required to visit Institute&amp;rsquo;s web site www. iibf.org.in &amp;gt;&amp;gt;&amp;gt; EXAMINATION/COURSES about IMPORTANT RULES/INFORMATION FOR CANDIDATES OF EXAMINATIONS&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SCHEDULE FOR CAIIB Elective EXAMINATIONS &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;619&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;EXAMINATION DATE&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SUBJECTS&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot; rowspan=&quot;5&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;21-12-2025&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;1. Rural Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;2. Human Resources Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;3. Information Technology &amp;amp; Digital Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;4. Risk Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;5. Central Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION SCHEDULE :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination schedule is given on the website www.iibf.org.in.&amp;nbsp; Institute reserves the right to change the Examination schedule already announced for any valid reason and said&amp;nbsp;changes will be notified on our website. In such case/s Candidates are required to appear for the examination as per&amp;nbsp;the revised schedule. Pl note that candidate/s will neither be entitled for&amp;nbsp;Refund of examination fees already paid nor adjustment of fees so paid against any future examinations of the Institute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;ELIGIBILITY&lt;/strong&gt;: Eligibility is governed by rules published in the Rules and Syllabus of examination. Candidates are required to&amp;nbsp;&lt;strong&gt;register for the examination through online&amp;nbsp;&lt;/strong&gt;during the open period of registration as mentioned in the time table of the Examination.&amp;nbsp; Application will not be accepted after the last date.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION FEES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;First Attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;Subsequent each attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;* Plus convenience charges and Taxes as applicable&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;MODE OF EXAMINATION:&lt;/strong&gt;&lt;br /&gt;\r\nInstitute will conduct examination in On-line mode only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;MEDIUM OF EXAMINATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination will be conducted in English and Hindi only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION CENTRES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates should appear for the examination only at the centre where they are working provided there is an examination centre at such place and if there is no examination centre, they should appear at the nearest examination centre. Result of candidate violating this rule or giving wrong information is liable for cancellation.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates are required to take utmost care and precaution in selecting the Centre as there is no provision to change the Centre in the system. Hence no request for change of centre will be entertained for any reason. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;The Institute reserves the right to close any of the existing centre/s on account of less number of candidates appearing from that centre or any other reason which it may think fit. In such case, candidate will be advised to appear at the examination from the nearest available centre.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;STUDY MATERIAL:&lt;/strong&gt;&amp;nbsp;Examination fee does not include cost of study material. Please refer Rules &amp;amp; Syllabus of the examination at&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute has developed a courseware to cover the syllabus. Candidates are advised to make full use of the courseware and also the updates put on the IIBF website from time to time. However, as banking and finance fields are dynamic, rules and regulations witness rapid changes. Hence, candidates should keep themselves updated on latest developments by going through Master Circulars issued by RBI, visiting the websites of organizations like RBI, SEBI, BIS etc. Please refer &amp;ldquo;Pattern of Examination&amp;rdquo;&amp;nbsp;given in Rules &amp;amp; Syllabus of the examination at www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;USE OF SCRIBE:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;For Visually impaired &amp;amp; Orthopedically Challenged candidates, for using Scribe at the examinations of the Institute, refer the Rules/Guidelines available on the web site of the institute at www.iibf.org.in.&amp;nbsp; Candidates are advised to apply online for scribe well in advance, not later than 3 days before the examination. (This is required to make suitable arrangements at the examination venue). Candidate is required to follow this procedure for each subject of examination in case the help of scribe is required. For detailed scribe guidelines, kindly refer to the &amp;nbsp;&lt;a href=&quot;https://iibf.esdsconnect.com/uploads/Scribe_Guideline_2024.pdf&quot; target=&quot;_blank&quot;&gt;GUIDELINES/RULES FOR USING SCRIBE BY VISUALLY IMPAIRED &amp;amp; ORTHOPEADICALLY CHALLENGED CANDIDATES&lt;/a&gt; on the IIBF website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;OTHER INFORMATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required&amp;nbsp;to read the instructions /information about ON-LINE examination before appearing for the examinations. The instructions are available on Institute&amp;#39;s website www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ADMIT LETTER OF EXAMINATIONS&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;After successful registration of examination, SMS/email will be sent to the candidate intimating the receipt of examination forms.&amp;nbsp; Please note that the admit letters will be available for download on the Institute&amp;rsquo;s website as well as in the candidate login 10 days before the exam. Candidate/s will be able to save, download and print admit letter only 10 days before the exam.&lt;/li&gt;\r\n	&lt;li&gt;Admit letter will be hosted on Institute&amp;rsquo;s website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;under the menu &amp;lsquo;Examination /Courses&amp;gt;Admit Letter&amp;rdquo;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;For downloading and printing of admit letter from the above mentioned website, candidates will have to enter the following:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; i.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Membership or registration number as&amp;nbsp;&lt;strong&gt;login&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong&gt;Edit profile password&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; iii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If candidates do not remember their Edit profile password, they have to click on the &amp;lsquo;Forgot password/Get Password&amp;rsquo; button after entering the Membership or Registration number. On clicking fresh edit profile password will be sent to their registered email id.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required to&amp;nbsp;&lt;strong&gt;produce hard copy of admit letter&lt;/strong&gt;&amp;nbsp;along with Membership identity card or any other valid photo ID card at the examination venue.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the absence of hard copy of Admit Letter and Photo Identity Card, candidates will be denied permission to write Examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Mobile Phones&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Mobile phones and other electronic gadgets (except calculator as permissible) are not allowed in the examination hall. It is clarified that mere possession of mobile phone in the examination hall whether in switch off mode or silent mode shall also be deemed to be resorting to adoption of unfair means in the examination.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Use of calculator&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates will be allowed to use battery operated portable calculator in the exam. The calculator can be of any type upto 6 functions, 12 digits.&lt;/p&gt;\r\n\r\n&lt;p&gt;Attempt to use any other type of calculator not complying with the specifications indicated above or having more features than mentioned above shall tantamount to use of unfair means. Scientific calculator is not allowed.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Other Rules/Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Candidates should ensure that they sign the Attendance Sheet.&lt;/li&gt;\r\n	&lt;li&gt;Candidates are advised to reach the Examination Venue before the reporting time mentioned in the admit letter.&amp;nbsp;&lt;strong&gt;No candidate/s will be permitted to enter the Examination Venue after the gate closing time mentioned in the admit letter.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;No candidate will be permitted to leave the examination venue in the first 60 minutes from the scheduled start time of the examination&lt;/strong&gt;.&lt;strong&gt; In case, the candidates have reported late and are found to be Arguing/Misbehaving with the Test Administrator, the candidate/s may be booked under Unfair Practice and debarred for a period of 15 months.&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Candidates would be able to login to the system only with the password mentioned in this Admit Letter. This password should not be disclosed to others. Keep it safe to avoid the possible misuse.&lt;/p&gt;\r\n\r\n&lt;p&gt;If the examination could not commence on scheduled time or there is delay due to Failure of power, Technical snag of whatsoever nature or for any such reason having bearing upon the conduct of examination; candidates have to: -&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Wait till resumption of power supply/solving of technical snag.&lt;/li&gt;\r\n	&lt;li&gt;Take-up the examination at other venue arranged by the examination conducting authority.&lt;/li&gt;\r\n	&lt;li&gt;Follow instructions given by the examination conducting authority.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates are required to strictly follow all the instructions given by the examination conducting authority during the examination and adhere to Rules of the examination. Violation of any of the Rules / Instructions, misuse of the Admit Letter will be considered to be an act of serious misconduct and the Institute will take action as per the Rules of the examination, which will also be reported to the employer of the candidate.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Rules, Penalties for Misconduct / Unfair Practices :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Communication of any sort between candidates or with outsiders is not permitted and complete silence should be maintained during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Copying answers from other candidates/other printed/Electronic material or permitting others to copy or consultation of any kind will attract the rules relating to unfair practices in the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall impersonate others or allow others to impersonate himself/herself at the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall misbehave/argue with the Examination Conducting Authorities at the centre.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates have to compulsory return any papers given including that given for rough work to invigilator.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates should not possess and / or use books, notes, periodicals, etc. in the examination hall at the time of examination / or use mathematical tables, slide rules, stencils etc. during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;If any candidate violates any of the above rules, it will be considered to be an act of misconduct and he/she will be liable for punishment mentioned below.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;PENALTIES FOR MISCONDUCT / UNFAIR PRACTICES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall have the right to impose penalties on any candidate for committing an act of misconduct/unfair practice in respect of any matter affecting the Institute or in respect of any examination conducted by the Institute or disqualifying any candidate who, they have reason to believe has received or given unfair assistance at the examination, and&lt;/p&gt;\r\n\r\n&lt;p&gt;(i) to cancel the result of such candidate in all or any of the subjects of the examination at which he/she may have appeared;&lt;/p&gt;\r\n\r\n&lt;p&gt;(ii) to exclude him/her from future examinations either permanently or for a specified number of examinations;&lt;/p&gt;\r\n\r\n&lt;p&gt;(iii) to report his/her name to his/her employer and&lt;/p&gt;\r\n\r\n&lt;p&gt;(iv) to take such other action against him/her as the Institute shall in their sole discretion deem fit and the decision of the Institute shall be final and binding on the candidate concerned.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall also have right to cancel results of any subsequent examination at which the candidate may have appeared, if such examination falls within the exclusion period in the penalty, as by reason of imposition of such a penalty of exclusion from the future examination, the candidate would not have been eligible to appear at such subsequent examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the event of any dispute between the Institute and the member, only Competent Courts in Chennai, Kolkata, New Delhi and Mumbai alone have the jurisdiction to entertain the dispute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;DECLARATION OF RESULTS :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Results will be normally declared within 1 month of the conclusion of the examination. Printed result advices (original as well as duplicate) will not be sent but the same will be available on Institute&amp;#39;s website &amp;#39;www.iibf.org.in&amp;#39;, in&amp;nbsp;printable form. Candidates are required&amp;nbsp;to&amp;nbsp;download the same.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Multiple Choice Questions (MCQs) and Answers&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;ldquo;The Institute conducts its examinations through Multiple Choice&amp;nbsp; Questions (MCQs).&amp;nbsp; These MCQs are part of the&amp;nbsp; Question Bank of&amp;nbsp; the Institute and its Intellectual Property .&amp;nbsp; As a matter of policy, these MCQs and their answers will not be shared by the Institute with the candidates or others and no correspondence in this regard will be entertained.&amp;quot;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;FACILITY FOR VERIFICATION OF MARKS:&amp;nbsp;&lt;/strong&gt;&lt;br /&gt;\r\nFacility of verification of marks will not be available for Objective Type (Multiple Choice Questions) Online examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Marksheet/Final Certificate&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Consolidated mark sheet for candidates completing&amp;nbsp;&lt;strong&gt;CAIIB&lt;/strong&gt;&amp;nbsp;examination, will be available on the Institute&amp;rsquo;s website after the declaration of results. Candidates can download the same after entering login credentials using their membership number and edit profile password.&lt;/p&gt;\r\n\r\n&lt;p&gt;Final certificates will be available on the website within 45 days after the declaration of result.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;CONTACT DETAILS:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Register your queries through website&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;strong&gt;&amp;nbsp;&amp;gt; Members/Candidates Support Services(Help)&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;or&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Email all your queries to&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;mailto:care@iibf.org.in&quot;&gt;care@iibf.org.in&lt;/a&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Member Support Service Office&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;191-F, Maker Towers, 19th Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Cuffe Parade, Mumbai - 400 005&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel. : 022-2218 3302 / 2218 5134&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For training/contact classes related queries contact:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Leadership Centre&lt;/p&gt;\r\n\r\n&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;Kohinoor City, Commercial-II, Tower-I, 3&lt;sup&gt;rd&lt;/sup&gt;&amp;nbsp;Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Kirol Road, Off L.B.S.Marg, Kurla West, Mumbai 400 070.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel : 022 25039746 / 9604 / 9907&lt;/p&gt;\r\n\r\n&lt;p&gt;Email : training@iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;table align=&quot;left&quot; border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;660&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;SOUTH ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;NORTH ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;EAST ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;WEST ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			No.94, Jawaharlal Nehru Road,&lt;br /&gt;\r\n			(100 Feet Road),&lt;br /&gt;\r\n			Opp.Hotel Ambica Empire, Vadapalani,&lt;br /&gt;\r\n			Chennai - 600 026.&lt;br /&gt;\r\n			Tel:044 24722990/24727961&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfsz@iibf.org.in&quot;&gt;Email:iibfsz@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance,&lt;br /&gt;\r\n			Professional Development Centre, Northern Zone,&lt;br /&gt;\r\n			C-5/30, Safdarjung Development Area(SDA),&lt;br /&gt;\r\n			Near SDA Local Shopping complex&lt;br /&gt;\r\n			Outer Ring Road, Opp IIT Delhi,&lt;br /&gt;\r\n			&amp;nbsp;NEW DELHI-110 016&lt;br /&gt;\r\n			Tel:011-2653 2194 / 2191 (office)&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfnz@iibf.org.in&quot;&gt;Email:iibfnz@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Avani Heights, 2nd Floor,&lt;br /&gt;\r\n			59A, Jawaharlal Nehru Road,&lt;br /&gt;\r\n			Kolkata - 700020&lt;br /&gt;\r\n			Tel: 033-46032850&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfez@iibf.org.in&quot;&gt;Email:iibfez@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Professional Development Centre&lt;br /&gt;\r\n			192-F, Maker Towers,&lt;br /&gt;\r\n			19th Floor, Cuffe Parade&lt;br /&gt;\r\n			MUMBAI - 400 005&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Corporate Office&lt;/strong&gt;&amp;nbsp;: &amp;nbsp;Indian Institute of Banking &amp;amp; Finance, Kohinoor City, Commercial-II, Tower-1, 2nd Floor, Kirol Road, Kurla (West), Mumbai - 400 070 Tel : 022-2503 9746 / 9604 / 9907.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;PROFESSIONAL DEVELOPMENT CENTRES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Please quote your membership/registration number in all your emails.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For more details, updates and instructions please refer Rules and Syllabus Booklet or visit Institute&amp;#39;s Website &amp;ndash;&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org/&quot;&gt;&lt;strong&gt;www.iibf.org.in&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;.&lt;/strong&gt;&lt;/p&gt;\";s:11:\"exam_delete\";s:1:\"0\";s:10:\"created_by\";s:1:\"5\";s:10:\"created_on\";s:19:\"2016-11-12 11:08:16\";s:11:\"modified_by\";s:1:\"0\";s:11:\"modified_on\";s:19:\"2025-09-01 13:28:58\";s:13:\"exam_category\";s:1:\"0\";s:14:\"elearning_flag\";s:1:\"N\";s:10:\"ebook_flag\";s:1:\"N\";s:12:\"sub_el_count\";s:0:\"\";}}', '5', '10.11.38.105')
ERROR - 2025-09-01 13:32:08 --> Query error: Table 'supp0rttest_iibf_staging.adminlogs' doesn't exist - Invalid query: INSERT INTO `adminlogs` (`date`, `title`, `description`, `userid`, `ip`) VALUES ('2025-09-01 13:32:08', 'Edit Exam Successful', 'a:2:{s:12:\"updated_data\";a:19:{s:9:\"exam_code\";s:3:\"508\";s:11:\"description\";s:30:\"CERTIFICATE IN RISK MANAGEMENT\";s:16:\"qualifying_exam1\";s:3:\"600\";s:16:\"qualifying_part1\";s:1:\"1\";s:16:\"qualifying_exam2\";s:3:\"600\";s:16:\"qualifying_part2\";s:1:\"1\";s:16:\"qualifying_exam3\";s:1:\" \";s:16:\"qualifying_part3\";s:1:\" \";s:9:\"exam_type\";s:1:\"3\";s:8:\"examprty\";s:1:\"Y\";s:11:\"examdescshr\";s:1:\"Y\";s:9:\"elg_mem_o\";s:1:\"Y\";s:9:\"elg_mem_a\";s:1:\"Y\";s:9:\"elg_mem_f\";s:1:\"Y\";s:10:\"elg_mem_nm\";s:1:\"N\";s:10:\"elg_mem_db\";s:1:\" \";s:21:\"exam_instruction_file\";s:14:\"20519_exam.pdf\";s:18:\"member_instruction\";s:22516:\"&lt;p align=&quot;center&quot;&gt;&lt;meta charset=&quot;utf-8&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;IMPORTANT INSTRUCTIONS TO THE CANDIDATES-&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;CAIIB Elective &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates&amp;nbsp;are required to visit Institute&amp;rsquo;s web site www. iibf.org.in &amp;gt;&amp;gt;&amp;gt; EXAMINATION/COURSES about IMPORTANT RULES/INFORMATION FOR CANDIDATES OF EXAMINATIONS&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SCHEDULE FOR CAIIB Elective EXAMINATIONS &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;619&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;EXAMINATION DATE&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SUBJECTS&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot; rowspan=&quot;5&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;21-12-2025&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;1. Rural Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;2. Human Resources Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;3. Information Technology &amp;amp; Digital Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;4. Risk Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;5. Central Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION SCHEDULE :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination schedule is given on the website www.iibf.org.in.&amp;nbsp; Institute reserves the right to change the Examination schedule already announced for any valid reason and said&amp;nbsp;changes will be notified on our website. In such case/s Candidates are required to appear for the examination as per&amp;nbsp;the revised schedule. Pl note that candidate/s will neither be entitled for&amp;nbsp;Refund of examination fees already paid nor adjustment of fees so paid against any future examinations of the Institute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;ELIGIBILITY&lt;/strong&gt;: Eligibility is governed by rules published in the Rules and Syllabus of examination. Candidates are required to&amp;nbsp;&lt;strong&gt;register for the examination through online&amp;nbsp;&lt;/strong&gt;during the open period of registration as mentioned in the time table of the Examination.&amp;nbsp; Application will not be accepted after the last date.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION FEES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;First Attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;Subsequent each attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;* Plus convenience charges and Taxes as applicable&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;MODE OF EXAMINATION:&lt;/strong&gt;&lt;br /&gt;\r\nInstitute will conduct examination in On-line mode only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;MEDIUM OF EXAMINATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination will be conducted in English and Hindi only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION CENTRES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates should appear for the examination only at the centre where they are working provided there is an examination centre at such place and if there is no examination centre, they should appear at the nearest examination centre. Result of candidate violating this rule or giving wrong information is liable for cancellation.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates are required to take utmost care and precaution in selecting the Centre as there is no provision to change the Centre in the system. Hence no request for change of centre will be entertained for any reason. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;The Institute reserves the right to close any of the existing centre/s on account of less number of candidates appearing from that centre or any other reason which it may think fit. In such case, candidate will be advised to appear at the examination from the nearest available centre.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;STUDY MATERIAL:&lt;/strong&gt;&amp;nbsp;Examination fee does not include cost of study material. Please refer Rules &amp;amp; Syllabus of the examination at&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute has developed a courseware to cover the syllabus. Candidates are advised to make full use of the courseware and also the updates put on the IIBF website from time to time. However, as banking and finance fields are dynamic, rules and regulations witness rapid changes. Hence, candidates should keep themselves updated on latest developments by going through Master Circulars issued by RBI, visiting the websites of organizations like RBI, SEBI, BIS etc. Please refer &amp;ldquo;Pattern of Examination&amp;rdquo;&amp;nbsp;given in Rules &amp;amp; Syllabus of the examination at www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;USE OF SCRIBE:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;For Visually impaired &amp;amp; Orthopedically Challenged candidates, for using Scribe at the examinations of the Institute, refer the Rules/Guidelines available on the web site of the institute at www.iibf.org.in.&amp;nbsp; Candidates are advised to apply online for scribe well in advance, not later than 3 days before the examination. (This is required to make suitable arrangements at the examination venue). Candidate is required to follow this procedure for each subject of examination in case the help of scribe is required. For detailed scribe guidelines, kindly refer to the &amp;nbsp;&lt;a href=&quot;https://iibf.esdsconnect.com/uploads/Scribe_Guideline_2024.pdf&quot; target=&quot;_blank&quot;&gt;GUIDELINES/RULES FOR USING SCRIBE BY VISUALLY IMPAIRED &amp;amp; ORTHOPEADICALLY CHALLENGED CANDIDATES&lt;/a&gt; on the IIBF website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;OTHER INFORMATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required&amp;nbsp;to read the instructions /information about ON-LINE examination before appearing for the examinations. The instructions are available on Institute&amp;#39;s website www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ADMIT LETTER OF EXAMINATIONS&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;After successful registration of examination, SMS/email will be sent to the candidate intimating the receipt of examination forms.&amp;nbsp; Please note that the admit letters will be available for download on the Institute&amp;rsquo;s website as well as in the candidate login 10 days before the exam. Candidate/s will be able to save, download and print admit letter only 10 days before the exam.&lt;/li&gt;\r\n	&lt;li&gt;Admit letter will be hosted on Institute&amp;rsquo;s website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;under the menu &amp;lsquo;Examination /Courses&amp;gt;Admit Letter&amp;rdquo;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;For downloading and printing of admit letter from the above mentioned website, candidates will have to enter the following:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; i.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Membership or registration number as&amp;nbsp;&lt;strong&gt;login&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong&gt;Edit profile password&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; iii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If candidates do not remember their Edit profile password, they have to click on the &amp;lsquo;Forgot password/Get Password&amp;rsquo; button after entering the Membership or Registration number. On clicking fresh edit profile password will be sent to their registered email id.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required to&amp;nbsp;&lt;strong&gt;produce hard copy of admit letter&lt;/strong&gt;&amp;nbsp;along with Membership identity card or any other valid photo ID card at the examination venue.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the absence of hard copy of Admit Letter and Photo Identity Card, candidates will be denied permission to write Examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Mobile Phones&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Mobile phones and other electronic gadgets (except calculator as permissible) are not allowed in the examination hall. It is clarified that mere possession of mobile phone in the examination hall whether in switch off mode or silent mode shall also be deemed to be resorting to adoption of unfair means in the examination.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Use of calculator&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates will be allowed to use battery operated portable calculator in the exam. The calculator can be of any type upto 6 functions, 12 digits.&lt;/p&gt;\r\n\r\n&lt;p&gt;Attempt to use any other type of calculator not complying with the specifications indicated above or having more features than mentioned above shall tantamount to use of unfair means. Scientific calculator is not allowed.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Other Rules/Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Candidates should ensure that they sign the Attendance Sheet.&lt;/li&gt;\r\n	&lt;li&gt;Candidates are advised to reach the Examination Venue before the reporting time mentioned in the admit letter.&amp;nbsp;&lt;strong&gt;No candidate/s will be permitted to enter the Examination Venue after the gate closing time mentioned in the admit letter.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;No candidate will be permitted to leave the examination venue in the first 60 minutes from the scheduled start time of the examination&lt;/strong&gt;.&lt;strong&gt; In case, the candidates have reported late and are found to be Arguing/Misbehaving with the Test Administrator, the candidate/s may be booked under Unfair Practice and debarred for a period of 15 months.&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Candidates would be able to login to the system only with the password mentioned in this Admit Letter. This password should not be disclosed to others. Keep it safe to avoid the possible misuse.&lt;/p&gt;\r\n\r\n&lt;p&gt;If the examination could not commence on scheduled time or there is delay due to Failure of power, Technical snag of whatsoever nature or for any such reason having bearing upon the conduct of examination; candidates have to: -&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Wait till resumption of power supply/solving of technical snag.&lt;/li&gt;\r\n	&lt;li&gt;Take-up the examination at other venue arranged by the examination conducting authority.&lt;/li&gt;\r\n	&lt;li&gt;Follow instructions given by the examination conducting authority.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates are required to strictly follow all the instructions given by the examination conducting authority during the examination and adhere to Rules of the examination. Violation of any of the Rules / Instructions, misuse of the Admit Letter will be considered to be an act of serious misconduct and the Institute will take action as per the Rules of the examination, which will also be reported to the employer of the candidate.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Rules, Penalties for Misconduct / Unfair Practices :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Communication of any sort between candidates or with outsiders is not permitted and complete silence should be maintained during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Copying answers from other candidates/other printed/Electronic material or permitting others to copy or consultation of any kind will attract the rules relating to unfair practices in the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall impersonate others or allow others to impersonate himself/herself at the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall misbehave/argue with the Examination Conducting Authorities at the centre.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates have to compulsory return any papers given including that given for rough work to invigilator.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates should not possess and / or use books, notes, periodicals, etc. in the examination hall at the time of examination / or use mathematical tables, slide rules, stencils etc. during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;If any candidate violates any of the above rules, it will be considered to be an act of misconduct and he/she will be liable for punishment mentioned below.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;PENALTIES FOR MISCONDUCT / UNFAIR PRACTICES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall have the right to impose penalties on any candidate for committing an act of misconduct/unfair practice in respect of any matter affecting the Institute or in respect of any examination conducted by the Institute or disqualifying any candidate who, they have reason to believe has received or given unfair assistance at the examination, and&lt;/p&gt;\r\n\r\n&lt;p&gt;(i) to cancel the result of such candidate in all or any of the subjects of the examination at which he/she may have appeared;&lt;/p&gt;\r\n\r\n&lt;p&gt;(ii) to exclude him/her from future examinations either permanently or for a specified number of examinations;&lt;/p&gt;\r\n\r\n&lt;p&gt;(iii) to report his/her name to his/her employer and&lt;/p&gt;\r\n\r\n&lt;p&gt;(iv) to take such other action against him/her as the Institute shall in their sole discretion deem fit and the decision of the Institute shall be final and binding on the candidate concerned.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall also have right to cancel results of any subsequent examination at which the candidate may have appeared, if such examination falls within the exclusion period in the penalty, as by reason of imposition of such a penalty of exclusion from the future examination, the candidate would not have been eligible to appear at such subsequent examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the event of any dispute between the Institute and the member, only Competent Courts in Chennai, Kolkata, New Delhi and Mumbai alone have the jurisdiction to entertain the dispute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;DECLARATION OF RESULTS :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Results will be normally declared within 1 month of the conclusion of the examination. Printed result advices (original as well as duplicate) will not be sent but the same will be available on Institute&amp;#39;s website &amp;#39;www.iibf.org.in&amp;#39;, in&amp;nbsp;printable form. Candidates are required&amp;nbsp;to&amp;nbsp;download the same.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Multiple Choice Questions (MCQs) and Answers&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;ldquo;The Institute conducts its examinations through Multiple Choice&amp;nbsp; Questions (MCQs).&amp;nbsp; These MCQs are part of the&amp;nbsp; Question Bank of&amp;nbsp; the Institute and its Intellectual Property .&amp;nbsp; As a matter of policy, these MCQs and their answers will not be shared by the Institute with the candidates or others and no correspondence in this regard will be entertained.&amp;quot;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;FACILITY FOR VERIFICATION OF MARKS:&amp;nbsp;&lt;/strong&gt;&lt;br /&gt;\r\nFacility of verification of marks will not be available for Objective Type (Multiple Choice Questions) Online examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Marksheet/Final Certificate&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Consolidated mark sheet for candidates completing&amp;nbsp;&lt;strong&gt;CAIIB&lt;/strong&gt;&amp;nbsp;examination, will be available on the Institute&amp;rsquo;s website after the declaration of results. Candidates can download the same after entering login credentials using their membership number and edit profile password.&lt;/p&gt;\r\n\r\n&lt;p&gt;Final certificates will be available on the website within 45 days after the declaration of result.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;CONTACT DETAILS:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Register your queries through website&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;strong&gt;&amp;nbsp;&amp;gt; Members/Candidates Support Services(Help)&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;or&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Email all your queries to&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;mailto:care@iibf.org.in&quot;&gt;care@iibf.org.in&lt;/a&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Member Support Service Office&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;191-F, Maker Towers, 19th Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Cuffe Parade, Mumbai - 400 005&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel. : 022-2218 3302 / 2218 5134&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For training/contact classes related queries contact:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Leadership Centre&lt;/p&gt;\r\n\r\n&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;Kohinoor City, Commercial-II, Tower-I, 3&lt;sup&gt;rd&lt;/sup&gt;&amp;nbsp;Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Kirol Road, Off L.B.S.Marg, Kurla West, Mumbai 400 070.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel : 022 25039746 / 9604 / 9907&lt;/p&gt;\r\n\r\n&lt;p&gt;Email : training@iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;table align=&quot;left&quot; border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;660&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;SOUTH ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;NORTH ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;EAST ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;WEST ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			No.94, Jawaharlal Nehru Road,&lt;br /&gt;\r\n			(100 Feet Road),&lt;br /&gt;\r\n			Opp.Hotel Ambica Empire, Vadapalani,&lt;br /&gt;\r\n			Chennai - 600 026.&lt;br /&gt;\r\n			Tel:044 24722990/24727961&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfsz@iibf.org.in&quot;&gt;Email:iibfsz@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance,&lt;br /&gt;\r\n			Professional Development Centre, Northern Zone,&lt;br /&gt;\r\n			C-5/30, Safdarjung Development Area(SDA),&lt;br /&gt;\r\n			Near SDA Local Shopping complex&lt;br /&gt;\r\n			Outer Ring Road, Opp IIT Delhi,&lt;br /&gt;\r\n			&amp;nbsp;NEW DELHI-110 016&lt;br /&gt;\r\n			Tel:011-2653 2194 / 2191 (office)&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfnz@iibf.org.in&quot;&gt;Email:iibfnz@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Avani Heights, 2nd Floor,&lt;br /&gt;\r\n			59A, Jawaharlal Nehru Road,&lt;br /&gt;\r\n			Kolkata - 700020&lt;br /&gt;\r\n			Tel: 033-46032850&lt;br /&gt;\r\n			&lt;a href=&quot;mailto:iibfez@iibf.org.in&quot;&gt;Email:iibfez@iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;br /&gt;\r\n			Professional Development Centre&lt;br /&gt;\r\n			192-F, Maker Towers,&lt;br /&gt;\r\n			19th Floor, Cuffe Parade&lt;br /&gt;\r\n			MUMBAI - 400 005&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Corporate Office&lt;/strong&gt;&amp;nbsp;: &amp;nbsp;Indian Institute of Banking &amp;amp; Finance, Kohinoor City, Commercial-II, Tower-1, 2nd Floor, Kirol Road, Kurla (West), Mumbai - 400 070 Tel : 022-2503 9746 / 9604 / 9907.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;PROFESSIONAL DEVELOPMENT CENTRES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Please quote your membership/registration number in all your emails.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For more details, updates and instructions please refer Rules and Syllabus Booklet or visit Institute&amp;#39;s Website &amp;ndash;&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org/&quot;&gt;&lt;strong&gt;www.iibf.org.in&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;.&lt;/strong&gt;&lt;/p&gt;\";s:21:\"nonmember_instruction\";s:22516:\"&lt;p align=&quot;center&quot;&gt;&lt;meta charset=&quot;utf-8&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;IMPORTANT INSTRUCTIONS TO THE CANDIDATES-&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;CAIIB Elective &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates&amp;nbsp;are required to visit Institute&amp;rsquo;s web site www. iibf.org.in &amp;gt;&amp;gt;&amp;gt; EXAMINATION/COURSES about IMPORTANT RULES/INFORMATION FOR CANDIDATES OF EXAMINATIONS&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SCHEDULE FOR CAIIB Elective EXAMINATIONS &amp;ndash; Dec 2025&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;619&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;EXAMINATION DATE&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;SUBJECTS&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot; rowspan=&quot;5&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;21-12-2025&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;1. Rural Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;2. Human Resources Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;3. Information Technology &amp;amp; Digital Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;4. Risk Management&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td nowrap=&quot;nowrap&quot;&gt;\r\n			&lt;p align=&quot;center&quot;&gt;5. Central Banking&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION SCHEDULE :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination schedule is given on the website www.iibf.org.in.&amp;nbsp; Institute reserves the right to change the Examination schedule already announced for any valid reason and said&amp;nbsp;changes will be notified on our website. In such case/s Candidates are required to appear for the examination as per&amp;nbsp;the revised schedule. Pl note that candidate/s will neither be entitled for&amp;nbsp;Refund of examination fees already paid nor adjustment of fees so paid against any future examinations of the Institute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;ELIGIBILITY&lt;/strong&gt;: Eligibility is governed by rules published in the Rules and Syllabus of examination. Candidates are required to&amp;nbsp;&lt;strong&gt;register for the examination through online&amp;nbsp;&lt;/strong&gt;during the open period of registration as mentioned in the time table of the Examination.&amp;nbsp; Application will not be accepted after the last date.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION FEES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;First Attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;Subsequent each attempt&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&lt;strong&gt;1,100*&lt;/strong&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;* Plus convenience charges and Taxes as applicable&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;MODE OF EXAMINATION:&lt;/strong&gt;&lt;br /&gt;\r\nInstitute will conduct examination in On-line mode only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;MEDIUM OF EXAMINATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Examination will be conducted in English and Hindi only.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;EXAMINATION CENTRES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates should appear for the examination only at the centre where they are working provided there is an examination centre at such place and if there is no examination centre, they should appear at the nearest examination centre. Result of candidate violating this rule or giving wrong information is liable for cancellation.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Candidates are required to take utmost care and precaution in selecting the Centre as there is no provision to change the Centre in the system. Hence no request for change of centre will be entertained for any reason. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;The Institute reserves the right to close any of the existing centre/s on account of less number of candidates appearing from that centre or any other reason which it may think fit. In such case, candidate will be advised to appear at the examination from the nearest available centre.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;STUDY MATERIAL:&lt;/strong&gt;&amp;nbsp;Examination fee does not include cost of study material. Please refer Rules &amp;amp; Syllabus of the examination at&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute has developed a courseware to cover the syllabus. Candidates are advised to make full use of the courseware and also the updates put on the IIBF website from time to time. However, as banking and finance fields are dynamic, rules and regulations witness rapid changes. Hence, candidates should keep themselves updated on latest developments by going through Master Circulars issued by RBI, visiting the websites of organizations like RBI, SEBI, BIS etc. Please refer &amp;ldquo;Pattern of Examination&amp;rdquo;&amp;nbsp;given in Rules &amp;amp; Syllabus of the examination at www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;USE OF SCRIBE:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;For Visually impaired &amp;amp; Orthopedically Challenged candidates, for using Scribe at the examinations of the Institute, refer the Rules/Guidelines available on the web site of the institute at www.iibf.org.in.&amp;nbsp; Candidates are advised to apply online for scribe well in advance, not later than 3 days before the examination. (This is required to make suitable arrangements at the examination venue). Candidate is required to follow this procedure for each subject of examination in case the help of scribe is required. For detailed scribe guidelines, kindly refer to the &amp;nbsp;&lt;a href=&quot;https://iibf.esdsconnect.com/uploads/Scribe_Guideline_2024.pdf&quot; target=&quot;_blank&quot;&gt;GUIDELINES/RULES FOR USING SCRIBE BY VISUALLY IMPAIRED &amp;amp; ORTHOPEADICALLY CHALLENGED CANDIDATES&lt;/a&gt; on the IIBF website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;OTHER INFORMATION:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required&amp;nbsp;to read the instructions /information about ON-LINE examination before appearing for the examinations. The instructions are available on Institute&amp;#39;s website www.iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ADMIT LETTER OF EXAMINATIONS&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;After successful registration of examination, SMS/email will be sent to the candidate intimating the receipt of examination forms.&amp;nbsp; Please note that the admit letters will be available for download on the Institute&amp;rsquo;s website as well as in the candidate login 10 days before the exam. Candidate/s will be able to save, download and print admit letter only 10 days before the exam.&lt;/li&gt;\r\n	&lt;li&gt;Admit letter will be hosted on Institute&amp;rsquo;s website&amp;nbsp;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&amp;nbsp;under the menu &amp;lsquo;Examination /Courses&amp;gt;Admit Letter&amp;rdquo;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;For downloading and printing of admit letter from the above mentioned website, candidates will have to enter the following:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; i.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Membership or registration number as&amp;nbsp;&lt;strong&gt;login&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong&gt;Edit profile password&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; iii.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If candidates do not remember their Edit profile password, they have to click on the &amp;lsquo;Forgot password/Get Password&amp;rsquo; button after entering the Membership or Registration number. On clicking fresh edit profile password will be sent to their registered email id.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates are required to&amp;nbsp;&lt;strong&gt;produce hard copy of admit letter&lt;/strong&gt;&amp;nbsp;along with Membership identity card or any other valid photo ID card at the examination venue.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the absence of hard copy of Admit Letter and Photo Identity Card, candidates will be denied permission to write Examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Mobile Phones&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Mobile phones and other electronic gadgets (except calculator as permissible) are not allowed in the examination hall. It is clarified that mere possession of mobile phone in the examination hall whether in switch off mode or silent mode shall also be deemed to be resorting to adoption of unfair means in the examination.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Use of calculator&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates will be allowed to use battery operated portable calculator in the exam. The calculator can be of any type upto 6 functions, 12 digits.&lt;/p&gt;\r\n\r\n&lt;p&gt;Attempt to use any other type of calculator not complying with the specifications indicated above or having more features than mentioned above shall tantamount to use of unfair means. Scientific calculator is not allowed.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Other Rules/Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Candidates should ensure that they sign the Attendance Sheet.&lt;/li&gt;\r\n	&lt;li&gt;Candidates are advised to reach the Examination Venue before the reporting time mentioned in the admit letter.&amp;nbsp;&lt;strong&gt;No candidate/s will be permitted to enter the Examination Venue after the gate closing time mentioned in the admit letter.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;No candidate will be permitted to leave the examination venue in the first 60 minutes from the scheduled start time of the examination&lt;/strong&gt;.&lt;strong&gt; In case, the candidates have reported late and are found to be Arguing/Misbehaving with the Test Administrator, the candidate/s may be booked under Unfair Practice and debarred for a period of 15 months.&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Candidates would be able to login to the system only with the password mentioned in this Admit Letter. This password should not be disclosed to others. Keep it safe to avoid the possible misuse.&lt;/p&gt;\r\n\r\n&lt;p&gt;If the examination could not commence on scheduled time or there is delay due to Failure of power, Technical snag of whatsoever nature or for any such reason having bearing upon the conduct of examination; candidates have to: -&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Wait till resumption of power supply/solving of technical snag.&lt;/li&gt;\r\n	&lt;li&gt;Take-up the examination at other venue arranged by the examination conducting authority.&lt;/li&gt;\r\n	&lt;li&gt;Follow instructions given by the examination conducting authority.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates are required to strictly follow all the instructions given by the examination conducting authority during the examination and adhere to Rules of the examination. Violation of any of the Rules / Instructions, misuse of the Admit Letter will be considered to be an act of serious misconduct and the Institute will take action as per the Rules of the examination, which will also be reported to the employer of the candidate.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Rules, Penalties for Misconduct / Unfair Practices :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Communication of any sort between candidates or with outsiders is not permitted and complete silence should be maintained during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Copying answers from other candidates/other printed/Electronic material or permitting others to copy or consultation of any kind will attract the rules relating to unfair practices in the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall impersonate others or allow others to impersonate himself/herself at the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;No candidate shall misbehave/argue with the Examination Conducting Authorities at the centre.&lt;/p&gt;\r\n\r\n&lt;p&gt;Candidates have to compulsory return any papers given including that given for rough work to invigilator.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Candidates should not possess and / or use books, notes, periodicals, etc. in the examination hall at the time of examination / or use mathematical tables, slide rules, stencils etc. during the examination.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;If any candidate violates any of the above rules, it will be considered to be an act of misconduct and he/she will be liable for punishment mentioned below.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;PENALTIES FOR MISCONDUCT / UNFAIR PRACTICES :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall have the right to impose penalties on any candidate for committing an act of misconduct/unfair practice in respect of any matter affecting the Institute or in respect of any examination conducted by the Institute or disqualifying any candidate who, they have reason to believe has received or given unfair assistance at the examination, and&lt;/p&gt;\r\n\r\n&lt;p&gt;(i) to cancel the result of such candidate in all or any of the subjects of the examination at which he/she may have appeared;&lt;/p&gt;\r\n\r\n&lt;p&gt;(ii) to exclude him/her from future examinations either permanently or for a specified number of examinations;&lt;/p&gt;\r\n\r\n&lt;p&gt;(iii) to report his/her name to his/her employer and&lt;/p&gt;\r\n\r\n&lt;p&gt;(iv) to take such other action against him/her as the Institute shall in their sole discretion deem fit and the decision of the Institute shall be final and binding on the candidate concerned.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Institute shall also have right to cancel results of any subsequent examination at which the candidate may have appeared, if such examination falls within the exclusion period in the penalty, as by reason of imposition of such a penalty of exclusion from the future examination, the candidate would not have been eligible to appear at such subsequent examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the event of any dispute between the Institute and the member, only Competent Courts in Chennai, Kolkata, New Delhi and Mumbai alone have the jurisdiction to entertain the dispute.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;DECLARATION OF RESULTS :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Results will be normally declared within 1 month of the conclusion of the examination. Printed result advices (original as well as duplicate) will not be sent but the same will be available on Institute&amp;#39;s website &amp;#39;www.iibf.org.in&amp;#39;, in&amp;nbsp;printable form. Candidates are required&amp;nbsp;to&amp;nbsp;download the same.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Multiple Choice Questions (MCQs) and Answers&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;ldquo;The Institute conducts its examinations through Multiple Choice&amp;nbsp; Questions (MCQs).&amp;nbsp; These MCQs are part of the&amp;nbsp; Question Bank of&amp;nbsp; the Institute and its Intellectual Property .&amp;nbsp; As a matter of policy, these MCQs and their answers will not be shared by the Institute with the candidates or others and no correspondence in this regard will be entertained.&amp;quot;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;FACILITY FOR VERIFICATION OF MARKS:&amp;nbsp;&lt;/strong&gt;&lt;br /&gt;\r\nFacility of verification of marks will not be available for Objective Type (Multiple Choice Questions) Online examinations.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Marksheet/Final Certificate&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Consolidated mark sheet for candidates completing&amp;nbsp;&lt;strong&gt;CAIIB&lt;/strong&gt;&amp;nbsp;examination, will be available on the Institute&amp;rsquo;s website after the declaration of results. Candidates can download the same after entering login credentials using their membership number and edit profile password.&lt;/p&gt;\r\n\r\n&lt;p&gt;Final certificates will be available on the website within 45 days after the declaration of result.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;CONTACT DETAILS:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Register your queries through website&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;http://www.iibf.org.in/&quot;&gt;www.iibf.org.in&lt;/a&gt;&lt;strong&gt;&amp;nbsp;&amp;gt; Members/Candidates Support Services(Help)&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;or&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Email all your queries to&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;mailto:care@iibf.org.in&quot;&gt;care@iibf.org.in&lt;/a&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Member Support Service Office&lt;/strong&gt;:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;191-F, Maker Towers, 19th Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Cuffe Parade, Mumbai - 400 005&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel. : 022-2218 3302 / 2218 5134&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;For training/contact classes related queries contact:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Leadership Centre&lt;/p&gt;\r\n\r\n&lt;p&gt;Indian Institute of Banking &amp;amp; Finance&lt;/p&gt;\r\n\r\n&lt;p&gt;Kohinoor City, Commercial-II, Tower-I, 3&lt;sup&gt;rd&lt;/sup&gt;&amp;nbsp;Floor,&lt;/p&gt;\r\n\r\n&lt;p&gt;Kirol Road, Off L.B.S.Marg, Kurla West, Mumbai 400 070.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tel : 022 25039746 / 9604 / 9907&lt;/p&gt;\r\n\r\n&lt;p&gt;Email : training@iibf.org.in&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;table align=&quot;left&quot; border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;660&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;\r\n			&lt;p align=&quot;center&quot;&gt;SOUTH ZONE&lt;/p&gt;\r\n			&lt;/th&gt;\r\n			&lt;th&gt;\